import Todo from './components/Todo';
import { ChakraProvider, Heading } from '@chakra-ui/react';

const Example = () => {
  return (
    <>
      <ChakraProvider>
        <Heading color='blue.200' marginTop='10' fontSize='5xl'>
          Reminder
        </Heading>
        <Todo />
      </ChakraProvider>
    </>
  );
};

export default Example;
